import {React, useContext} from "react";
//components
import User from "../../components/User/index.js";
import Payment from "../../components/Payment/index.js";
//styles
import { Wrapper, Content, UserInfoContainer, PaymentContainer, Christmas } from "./Form.styles.js";
import christmas from "../../images/christmas.jpg"

const Account = () => {

	return (
		<Wrapper>
			<Content>
				<UserInfoContainer> 
						<User> </User>
						<Christmas>
							<img src={christmas} alt="download google" width="100%" height="100%"/>
						</Christmas>
					</UserInfoContainer>
				<PaymentContainer><Payment></Payment></PaymentContainer>	

			</Content>
		</Wrapper>
	);
}

export default Account
